import ReactDOM from 'react-dom';
import { WeatherApi } from "../../src/api/api"


let WeatherMap = async () => {
    try {
        let Item = await WeatherApi();
        console.log(Item.data.records.location[0].weatherElement[0].time)
        console.log(Item.data.records.location[0].weatherElement[1].time)
        let Groups = [];
        for (let x = 0; x < Item.data.records.location[0].weatherElement.length; x++) {
            Groups.push(<div key={x}>{x}</div>)
        }
        // let TestText = Item.data.records.location[0].weatherElement.map((item, i) =>
        //     <div key={i}>
        //         {i}
        //         {/* <h6>{item["startTime"]}</h6>
        //         <h6>{item["endTime"]}</h6>
        //         <h6>{item["parameter"]["parameterName"]}</h6> */}
        //     </div>
        // )
        ReactDOM.render(
            <>{Groups}</>, document.getElementsByClassName("WeatherGroup")[0]
        );
    } catch (error) {
        console.log("異常", error);
    }
}

export function Weather() {
    setTimeout(() => {
        WeatherMap();
    }, 100);
    return <div className="WeatherGroup">天氣預測</div>
}
